import React, { Component } from 'react'
import Header from './Header'
import Menu from './Menu'
import QuestionContainer from './QuestionContainer'

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <Header />
        <Menu />
        <QuestionContainer />
      </React.Fragment>
    )
  }
}

export default App;
